CREATE TABLE IF NOT EXISTS bar_buddies.bars(
   name    VARCHAR(73) NOT NULL PRIMARY KEY
  ,license VARCHAR(7)
  ,phone   VARCHAR(12) NOT NULL
  ,lon     NUMERIC(12,7) NOT NULL
  ,lat     NUMERIC(10,7) NOT NULL
  ,number  VARCHAR(13)
  ,address VARCHAR(35)
  ,city    VARCHAR(25)
  ,state   VARCHAR(2) NOT NULL
);
